    public async Task<Location> GetRandomLocation()
    {
        List<Location> locations = await _context.Location.ToListAsync();
        return locations.Shuffle().First();
    }

    public async Task<Game> GetRandomGame()
    {
        List<Game> games = await _context.Game.ToListAsync();
        return games.Shuffle().First();
    }

    public async Task<GameTripUser> GetRandomUser()
    {
        List<GameTripUser> users = await _context.Users.ToListAsync();
        return users.Shuffle().First();
    }
